commits.sourceNew:
@Override
public boolean intersects(final Plane p, final GeoPoint[] notablePoints, final Membership... bounds) {
  for (GeoShape shape : shapes) {
    if (shape.intersects(p, notablePoints, bounds))
      return true;
  }
  return false;
}

